  max-width: 100%;
}

div.album {
  display: grid;
  grid-template-columns: 1fr 1fr;

  row-gap: 10px;
}

@media (min-width: 667px) {
  div.album {
    grid-template-columns: 1fr 1fr 1fr;
  }
}

  div.album {
    grid-template-columns: 1fr 1fr 1fr 1fr;
  }
}

div.album a {
  align-self: center;
}

div.album a img {
  max-width: 100%;
  height: auto;
}

a.big {
  font-size: 36px;
}
